import { Login } from './components/Login/Login';
import { Route, Routes } from 'react-router-dom';
import { Notifications } from './components/Accout/Notifications';
import { Connections } from './components//Connections';






function App() {
  return (
      <div>
          <Nav/>
          <Badges/>
          <Login/>
          {/* <Account/>
