          <Routes>
            <Route path="/account" element={<Account/>}/>
            <Route path="/notificarions" element={<Notifications/>}/>
            <Route path="/connections" element={<Connections/>}/>
          </Routes>

          <Registration/>
          <Login/>


      </div>
  );
}

export default App;
